import logo from './logo.svg';
import './App.css';
import Books from './pages/Books';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Books/>} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
